I met Toni at her hotel room where she decided to stay for a weekend. Her gal pal Blake was visiting her from out of town and they wanted to unwind. Blake had been divorced for a while and was still in the middle of figuring out the custody situation between her ex and her. Since she really needed some much deserved R and R, she called me over and also had Jack meet us out there. We hung out by the beach for a while but really got things going once we went up to the room. Blake is definitely a keeper after seeing how laid back she was and how absolutely HUGE her tits were.
